<!-- Describe your first thoughts on how to solve this problem. -->
The intuition behind the fibGenerator function is to generate the Fibonacci sequence using a generator.

# Approach
<!-- Describe your approach to solving the problem. -->
It follows the approach of calculating the Fibonacci numbers iteratively by keeping track of the previous and current values. The function yields the Fibonacci numbers one by one as it is called

# Complexity
- Time complexity:
<!-- Add your time complexity here, e.g. $$O(n)$$ -->
The time complexity of the solution is O(n), where n is the number of Fibonacci numbers to be generated. The loop runs for n iterations, and in each iteration, a constant amount of work is done to calculate the next Fibonacci number.

- Space complexity:
<!-- Add your space complexity here, e.g. $$O(n)$$ -->
The space complexity of the solution is O(1) because it only requires a constant amount of additional space to store the previous and current values.

# Code
