We define a generator function that yields the Fibonacci sequence. 

It initializes an array with the first two Fibonacci numbers, `0` and `1`, and yields them. 

Inside an infinite loop, it calculates the next Fibonacci number by adding the previous two numbers from the array and yields it. The array is then updated with the new values, shifting them to the left. 

By reusing the previously calculated numbers, we avoid redundant calculations and improves performance. When the generator is called, it generates Fibonacci numbers lazily on-demand, allowing for efficient memory usage and flexibility.

