# Intuition
<!-- Describe your first thoughts on how to solve this problem. -->
The code is intended to generate the Fibonacci sequence using a generator function. The Fibonacci sequence is a series of numbers where each number is the sum of the two preceding ones, usually starting with 0 and 1. The intuition behind the code is to use a generator to create an iterable sequence of Fibonacci numbers.

# Approach
<!-- Describe your approach to solving the problem. -->
The code defines a generator function named fibGenerator. Inside this function:

- Two variables, a and b, are initialized to 0 and 1 respectively. These variables will keep track of the last two Fibonacci numbers.

- The generator function starts by yielding the initial value a, which is 0.

- The for loop iterates from 1 to 49 (50 iterations in total). In each iteration, the next Fibonacci number c is calculated as the sum of the previous two numbers a and b.

- The current Fibonacci number a is yielded using the yield keyword.

- The values of a and b are then updated to prepare for the next iteration.

# Complexity
**- Time Complexity:**
The time complexity of the generator function mainly depends on the number of iterations in the loop. Since the loop iterates 50 times, the time complexity of generating the first 50 Fibonacci numbers is O(50), which is essentially **O(1)** in terms of practical considerations.

**- Space Complexity:** 
The space complexity is **O(1)** because the generator function only uses a constant amount of extra space for variables, regardless of the input size.

