# Intuition
<!-- Describe your first thoughts on how to solve this problem. -->
The given problem involves implementing a `Fibonacci` number generator using a generator function. The generator should yield Fibonacci numbers in sequence, starting from 0 and 1, and then generating subsequent Fibonacci numbers by summing the previous two numbers.

# Approach
<!-- Describe your approach to solving the problem. -->
1. Create a generator function `fibGenerator`.
2. Initialize two variables, `a` and `b`, to store the first two Fibonacci numbers: 0 and 1, respectively.
3. Use the `yield` keyword to yield the value of `a`, which is the first Fibonacci number and the value of `b`, which is the second Fibonacci number.
4. Run an infinite loop using `while(true)`. This loop will generate subsequent Fibonacci numbers indefinitely.
5. Inside the loop, calculate the next Fibonacci number by adding `a` and `b` and assign it to the variable `c`.
6. Update the values of `a` and `b` by shifting `b` to `a` and `c` to `b`, respectively. This prepares the variables for the next iteration.
7. Use the `yield` keyword to yield the value of `c`, which is the next Fibonacci number.
8. Since the loop is infinite, the generator function will keep yielding Fibonacci numbers as long as it is iterated.

